/*Table structure for table `transaksi_pembayaran` */

DROP TABLE IF EXISTS `transaksi_pembayaran`;

CREATE TABLE `transaksi_pembayaran` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `account_id` bigint(11) DEFAULT NULL,
  `total_nominal` decimal(20,2) DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `keterangan` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `account_id` (`account_id`),
  CONSTRAINT `transaksi_pembayaran_ibfk_1` FOREIGN KEY (`account_id`) REFERENCES `user` (`account_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;

